"""
performance benchmark for determining gcd() on 100355-digit real part gaussian integers
https://t5k.org/primes/page.php?id=89650
"""
from time import time
from sys import stderr, argv
from sympy import gcd, I

from RSA_numbers_factored import ggcd


if argv[-1] == "gmpy2":
    from gmpy2 import mpz  # pylint: disable=no-name-in-module

    print("gmpy2")
else:
    mpz = lambda x: x

p = mpz(65516468355 * 2 ** 333333 + 1)

# sqrtm1 determined by xxx in 588.154s on 2.5GHz i7-11850H
sqrtm1 = mpz(

)

assert pow(sqrtm1, 2, p) == p - 1

start = time()
t = ggcd((p, 0), (sqrtm1, 1))
mid = time()
t2 = gcd(p, sqrtm1 + I)
end = time()
print("ggcd((p, 0), (sqrtm1, 1)):", str(mid - start) + "s", file=stderr)
assert t[0] ** 2 + t[1] ** 2 == p
print("gcd(p, sqrtm1 + I):", str(end - mid) + "s", file=stderr)
x, y = t2.as_real_imag()
assert x**2 + y**2 == p
